Here is a basic outline of the steps I would take to create this extension:

1. Create a new directory for the extension and create the following files:
	* `manifest.json`: This file contains metadata for the extension, such as its name, description, and permissions.
	* `popup.html`: This file contains the HTML for the popup that will be displayed when the user clicks the extension's icon.
	* `popup.js`: This file contains the JavaScript code that will be executed when the popup is displayed.
	* `screenshot.js`: This file contains the JavaScript code that will be used to take the screenshot.
2. In `manifest.json`, add the necessary permissions and specify the popup HTML file.
3. In `popup.html`, add a button that will trigger the screenshot functionality when clicked.
4. In `popup.js`, add an event listener to the button that will call the `takeScreenshot` function when clicked.
5. In `screenshot.js`, use the `chrome.tabs` API to get the current tab and then use the `chrome.tabs.captureVisibleTab` method to capture the visible area of the tab. However, since we want to capture the entire page, we will use the `chrome.tabs.executeScript` method to inject a script into the page that will scroll to the bottom of the page and then capture the entire page.
6. Once the screenshot is captured, use the `chrome.downloads` API to download the screenshot to the user's computer.

